TOP_FPGA_INITS_HDL_CNT: process (clk) is
begin
    if rising_edge(clk) then
        if (ccnt = 0) then
            mcnt <= (mcnt + 1);
        end if;
        ccnt <= ((ccnt + 1) mod 50000000);
    end if;
end process TOP_FPGA_INITS_HDL_CNT;


TOP_FPGA_INITS_HDL_OUT: process (clk) is
begin
    if rising_edge(clk) then
        if (not to_boolean(we)) then
            mem(to_integer(mcnt)) := signed(resize(ccnt mod 128, 7));
        end if;
        leds <= resize(unsigned(mem(to_integer(mcnt))), 8);
        assert (mem(to_integer(mcnt)) = signed(resize(mcnt, 12) mod 128))
            report "*** AssertionError ***"
            severity error;
    end if;
end process TOP_FPGA_INITS_HDL_OUT;

